import React from "react";
import pokeData from "../data/pokeData.json";

const Pokemon = (props) => {
  const renderPokemon = () => {
    return props.pokeData.name.map((name) => {
      return <li>{name}</li>;
    });
  };
  return (
    <ul>
      <li>{props.name}</li>
      <li>{props.type}</li>
      <li>{props.url}</li>
    </ul>
  );
};

export default Pokemon;
